import React from "react";

export const NavButton = ({ name, onClick }) => (
	<button className="button hoverable" onClick={onClick}>
		{name}
	</button>
);

export const NavInput = ({ placeholder, onChange }) => (
	<input
		className="input"
		type="number"
		placeholder={placeholder}
		onChange={onChange}
	/>
);

export const AuthText = () => (
	<div className="auth-text-container">
		<img
			className="auth-text-img"
			src="images/Shock-logo.png"
			alt="shock-image"
		/>
		<div className="auth-text-header">Custom Engineering</div>
		<p className="auth-text-paragraph">
			Unlike most trampoline park manufactures in the industry, Shock
			Trampoline creates a unique, custom engineered structure per the
			customer’s needs and space. Each park system is made in the USA and
			fabricated by professional American steel fabricators. Unlike our
			competitors, Shock does not use standardized pieces or dimensions.
			Shock structures are designed and fabricated by hand to utilize
			every square foot of a customer’s building. Our custom builds
			maximize park space while still providing the safest jumping
			experience in the industry. Shock over-engineers trampoline
			structures to outlast all competitors with minimal maintenance and
			supervision. In addition to our custom structures, all shock
			structures include our patented impact attenuation technology.
		</p>
	</div>
);

export const BackgroundVideo = ({ link }) => (
	<div style="position: fixed; z-index: -99; width: 100%; height: 100%">
		<iframe
			frameBorder="0"
			height="100%"
			width="100%"
			src="https://youtube.com/embed/ID?autoplay=1&controls=0&showinfo=0&autohide=1"
		/>
	</div>
);
